CREATE TABLE role_21072018 (
  id   SERIAL PRIMARY KEY,
  name VARCHAR NOT NULL UNIQUE
);


CREATE TABLE user_detail_21072018 (
  id     SERIAL PRIMARY KEY,
  phone  VARCHAR(64) NOT NULL UNIQUE,
  email  VARCHAR(64) NOT NULL UNIQUE,
  age    INT,
  gender VARCHAR(64)
);


CREATE TABLE user_21072018 (
  id             SERIAL PRIMARY KEY,
  first_name     VARCHAR(64) NOT NULL,
  last_name      VARCHAR(64) NOT NULL,
  username       VARCHAR(64) UNIQUE,
  password       VARCHAR(64) NOT NULL,
  user_detail_id INT UNIQUE REFERENCES user_detail_21072018 (id),
  role_id        INT REFERENCES role_21072018 (id)
);


CREATE TABLE category_21072018 (
  id           SERIAL PRIMARY KEY,
  name         VARCHAR(64) NOT NULL,
  description  VARCHAR(500) NOT NULL,
  sub_category INT REFERENCES category_21072018 (id)
);


CREATE TABLE product_21072018 (
  id          SERIAL PRIMARY KEY,
  description VARCHAR(500)      NOT NULL,
  price       DOUBLE PRECISION NOT NULL,
  quantity    VARCHAR(64),
  active      BOOLEAN DEFAULT TRUE,
  category_id INT REFERENCES category_21072018 (id),
  user_id     INT REFERENCES user_21072018 (id)
);



CREATE TABLE order_status_21072018 (
  id       SERIAL PRIMARY KEY,
  name     VARCHAR NOT NULL UNIQUE
);


CREATE TABLE order_21072018 (
  id            SERIAL PRIMARY KEY,
  serial_number VARCHAR(50) NOT NULL UNIQUE,
  order_status_id INT REFERENCES order_status_21072018 (id)
);


CREATE TABLE order_product_21072018 (
  id         SERIAL PRIMARY KEY,
  product_id INT REFERENCES product_21072018 (id),
  order_id   INT REFERENCES order_21072018 (id)
);


CREATE TABLE comment_21072018 (
  id         SERIAL PRIMARY KEY,
  title      VARCHAR(64) NOT NULL,
  text       VARCHAR(300),
  is_deleted BOOLEAN DEFAULT FALSE,
  order_id   INT REFERENCES order_21072018 (id)
);



CREATE TABLE address_21072018 (
  id        SERIAL PRIMARY KEY,
  city      VARCHAR(64) NOT NULL,
  country   VARCHAR(64) NOT NULL,
  post_code INT         NOT NULL,
  user_id   INT UNIQUE REFERENCES user_21072018 (id)
);



CREATE TABLE tag_21072018 (
  id         SERIAL PRIMARY KEY,
  name       VARCHAR(64) NOT NULL,
  product_id INT REFERENCES product_21072018 (id)
);


-- 1) Сгруппировать продукты пользователей с ролями admin, user по категориям с подсчитанным количеством,
-- в которых количество комментариев больше 5

SELECT
  c.name,
  count(p.id)
FROM product_21072018 p
  JOIN user_21072018 u on p.user_id = u.id
  JOIN category_21072018 c on p.category_id = c.id
  JOIN order_product_21072018 op ON p.id = op.product_id
  JOIN order_21072018 o ON op.order_id = o.id
  JOIN comment_21072018 c2 ON o.id = c2.order_id
GROUP BY c.name, u.role_id
HAVING u.role_id IN (SELECT id
                     FROM role_21072018
                     WHERE name IN ('admin', 'user')) AND (SELECT count(c3.id)
                                                           FROM comment_21072018 c3
                                                             JOIN order_21072018 o2 on c3.order_id = o2.id) > 5;

-- 2) Сгруппировать пользователей по стране и сумме купленных товаров
-- country total_price

SELECT
  a.country,
  sum(p.price)
FROM user_21072018 u
JOIN address_21072018 a on u.id = a.user_id
JOIN product_21072018 p on u.id = p.user_id
GROUP BY a.country
